import numpy as np
import matplotlib.pyplot as plt
import seaborn as sns
from sklearn.metrics.pairwise import cosine_similarity
from scipy.cluster.hierarchy import linkage, dendrogram
from collections import Counter

promoter_start = 54300815
enhancer_positions = [54447910, 54675605, 54686585, 54688405, 54688965, 54690925,
                      54692125, 54695545, 54697845, 54698545, 54701285]
sequence_start = promoter_start
sequence_end = enhancer_positions[-1]

dna_sequence = "" # 替代用的模拟数据

def split_dna_sequence(sequence, segment_length=128):
    return [sequence[i:i+segment_length] for i in range(0, len(sequence) - segment_length + 1, segment_length)]

segments = split_dna_sequence(dna_sequence)

def extract_kmers(segments, k):
    kmer_set = set()
    for segment in segments:
        kmer_set.update(segment[i:i+k] for i in range(len(segment) - k + 1))
    return sorted(kmer_set)

def kmer_frequencies(segment, k, kmer_list):
    kmer_counts = Counter(segment[i:i+k] for i in range(len(segment) - k + 1))
    return np.array([kmer_counts.get(kmer, 0) for kmer in kmer_list])

k = 3
kmer_list = extract_kmers(segments, k)
kmer_vectors = np.array([kmer_frequencies(seg, k, kmer_list) for seg in segments])

kmer_vectors = kmer_vectors / np.linalg.norm(kmer_vectors, axis=1, keepdims=True)

similarity_matrix = cosine_similarity(kmer_vectors)

first_row = similarity_matrix[0, :]

plt.figure(figsize=(12, 2))
ax = sns.heatmap(first_row.reshape(1, -1), cmap='viridis', annot=False, cbar=True, xticklabels=False)
plt.title('Similarity Heatmap for the First Segment')
plt.xlabel('Segment Index')
plt.yticks([])

segment_length = 128
enhancer_indices = [(pos - sequence_start) // segment_length for pos in enhancer_positions]

for idx in enhancer_indices:
    plt.text(idx, 1.02, '|', color='red', fontsize=12, ha='center', va='bottom', transform=ax.get_xaxis_transform())

plt.show()